import SideNavBar from "../SideNavBar";
import Box from '@mui/material/Box';

function Author(){
    return(
        <>
        <Box sx = {{display:'flex'}}>
        <SideNavBar/>
        
         <Box component="main" sx={{ flexGrow: 1, p: 3 }}>
         <h1>Author</h1>
       
      </Box>
        </Box>  
        </>
    );
}
export default Author;
